import Header from './Header';
import { Toolbar,Container } from '@material-ui/core';

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const Layout = props => (
  <Container >
      <Header />
      {props.children}
  </Container>
);

export default Layout;
